svg.script:
document.addEventListener("DOMContentLoaded", () => {

  const logoFragments = Array.from(document.querySelectorAll(".logoFragment"));

  // Set initial opacity to 0
  logoFragments.forEach(el => {
    el.style.opacity = 0;
  });

  // Shuffle arrays for random order
  function shuffle(array) {
    for (let i = array.length - 1; i > 0; i--) {
      const j = Math.floor(Math.random() * (i + 1));
      [array[i], array[j]] = [array[j], array[i]];
    }
  }

  shuffle(logoFragments);

  // Animate logoFragments quickly — show x%
  const targetLogoCount = Math.ceil(logoFragments.length * 0.95);
  let logoShown = 0;
  const logoInterval = setInterval(() => {
    if (logoShown >= targetLogoCount) {
      clearInterval(logoInterval);
      return;
    }
    const el = logoFragments.shift();
    if (el) {
      el.style.opacity = 1;
      logoShown++;
    }
  }, 5); // fastest rate

});
